import { aliasData } from "../../http"
import Sidebar from "./Sidebar"
import { useEffect, useContext, useState } from "react";
import { CartContext } from "../../CartContext";
import Loader from "../Loader"

const Audio = () => {
    const { auth, baseURL } = useContext(CartContext);
    const [data, setData] = useState(null);
    const [load, setLoad] = useState(true);

    useEffect(() => {
        (async () => {
            try {
                const { data } = await aliasData({ alias: auth.user.alias, filetype: "audio recording" });
                // console.log(data.rows);
                setData(data.rows);
                setLoad(false);
            } catch (err) {
                console.log(err);
            }
        })();
    }, []);
    const handleClick = (e, index) => {
        if (e.target.innerHTML === "Details") {
            document.querySelector(`.control${index}`).style.display = "block";
            e.target.innerHTML = "Hide";
        } else {
            document.querySelector(`.control${index}`).style.display = "none";
            e.target.innerHTML = "Details";
        }
    }


    const handlePoint = (latitude, longitude) => {
        setMapLine(false);
        const googleMapsUrl = `https://www.google.com/maps?q=${latitude},${longitude}`;
        window.open(googleMapsUrl, "_blank");
    }

    const handleMapLine = (latitude, longitude) => {
        let prevLat = '';
        let prevLng = '';
        const newCoordinates = latitude.map((lat, index) => {
            if (lat === '' || lat === prevLat || longitude[index] === prevLng) {
                return null;
            }
            prevLat = lat;
            prevLng = longitude[index];
            return {
                latitude: parseFloat(lat),
                longitude: parseFloat(longitude[index]),
            };
        }).filter((coord) => coord !== null);

        var baseUrl = 'https://www.google.com/maps/dir/';
        var waypoints = newCoordinates.map(function (point) {
            return point.latitude + ',' + point.longitude;
        });
        var start = waypoints[0];
        var end = waypoints[waypoints.length - 1];
        var waypointsStr = waypoints.slice(1, waypoints.length - 1).join('/');
        var mapUrl = baseUrl + start + '/' + waypointsStr + '/' + end;
        // console.log(mapUrl);
        window.open(mapUrl, "_blank");
    };

    return (
        <div>
            <div className="container">
                <Sidebar />
                {
                    (load) ? <Loader />
                        :
                        <div className="main-sec" style={{ display: "inline-block", width: "100%", overflowY: "scroll" }}>
                            {
                                (data !== null) ?
                                    data.map((element, index) => {
                                        return (
                                            <div key={index}>
                                                <div className="minmized-p">
                                                    <img src="/images/music.png" alt="preview" />
                                                    <span>{element.filename}</span>
                                                    <span>{element.date}</span>
                                                    <button onClick={(e) => { handleClick(e, index) }}>Details</button>
                                                </div>
                                                <div className={`card control${index}`}>
                                                    <div className="preview-box">
                                                        <div className="cardInfo">
                                                            <p><span className="bold">Filename : </span>{element.filename}</p>
                                                            <p><span className="bold">Duration : </span>{element.duration}</p>
                                                            <p><span className="bold">Timestamp : </span>[ Date : {element.date} , Time : {element.time} ]</p>
                                                            <p><span className="bold">IP : </span>[ Address : {element.ip} , Type : {element.iptype} ]</p>
                                                            <p><span className="bold">Device : </span>[ Brand : {element.devicename} , Name : {element.devicetype} ]</p>
                                                        </div>
                                                        <div className="preview">
                                                            <a href={`${baseURL}/${element.filepath}`} target="_blank">
                                                                <audio controls>
                                                                    <source src={`${baseURL}/${element.filepath}`} type="audio/mpeg" />
                                                                </audio>
                                                            </a>
                                                        </div>
                                                    </div>
                                                    <table>
                                                        <thead>
                                                            <tr>
                                                                <th>Latitude</th>
                                                                <th>
                                                                    Longitude
                                                                    <img src="/images/map.png" alt="map-icon" className="icon" onClick={() => { handleLine(element.latitude, element.longitude) }} />
                                                                </th>
                                                            </tr>
                                                        </thead>
                                                        {
                                                            (element.latitude) ?
                                                                element.latitude.map((item, index) => {
                                                                    if (item !== '')
                                                                        return (
                                                                            <tbody>
                                                                                <tr>
                                                                                    <td>{item}</td>
                                                                                    <td>
                                                                                        {element.longitude[index]}
                                                                                        <img src="/images/map.png" alt="map-icon" className="icon" onClick={() => { handlePoint(item, element.longitude[index]) }} />
                                                                                        </td>
                                                                                </tr>
                                                                            </tbody>
                                                                        )
                                                                })
                                                                :
                                                                ""
                                                        }
                                                    </table>
                                                </div>
                                            </div>
                                        )
                                    })
                                    :
                                    ''
                            }
                        </div>

                }
            </div>

            <footer>
                © 2022 THE GREEN BRIDGE Ingenieurgesellschaft mbH
            </footer>
        </div>
    )
}

export default Audio
